import React from "react";
import "../css/mesCitations.css";

function MesCitations() {
  return (
    <div>
        <div className="title_mes_citations">
            <h3>Mes citations</h3>
        </div>

        <div className="create_search">

            <div className="btn_create">
                
                <button>
                <svg xmlns="http://www.w3.org/2000/svg" width="32" height="32" viewBox="0 0 15 15"><path fill="currentColor" fill-rule="evenodd" d="M7 7V1h1v6h6v1H8v6H7V8H1V7h6Z" clip-rule="evenodd"/></svg>
                ajouter une citation
                </button>
            </div>

            <div className="search_bar ">
                <input type="text" ></input>
                <svg xmlns="http://www.w3.org/2000/svg" width="15" height="15" viewBox="0 0 15 15"><path fill="none" stroke="#6303ac" d="m14.5 14.5l-4-4m-4 2a6 6 0 1 1 0-12a6 6 0 0 1 0 12Z"/></svg>
            </div>

        </div>
    </div>
  );
}

export default MesCitations;
